import React,{ Component } from 'react';
import {
    HomeWrap,
    HomeLeft,
    HomeRight,
    LeftBr
} from './style';
import LeftBanner from './component/LeftBanner';
import LeftContent from './component/LeftContent';
import LeftRecommend from './component/LeftRecommend'
class Home extends Component {
    render () {
        return(
            <HomeWrap>
                <HomeLeft>
                    <LeftBanner/>
                    <LeftRecommend/>
                    <LeftBr/>
                    <LeftContent/>
                </HomeLeft>
                <HomeRight></HomeRight>
            </HomeWrap>
        )
    }
}
export default Home;
